	add("cleat", "{\"term\":\"cleat\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027clete\u0027 from Old english (ca. 450-1100) {{m|ang|clēat}}, from Proto-germanic {{m|gem-pro|*klautaz||firm lump}}, from Proto-indo-european {{m|gem-pro|*gelewd-}}, from {{m|ine-pro|*gley-||to glue, stick together, form into a ball}}. Cognate with Dutch \u0027kloot\u0027 (ball; testicle) and German \u0027kloß\u0027 See also \u0027\u0027 and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strip of wood or iron fastened on transversely to something in order to give strength, prevent warping, hold position, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, w:Herman Herman Melville, \u0027w:Moby Moby Dick\u0027, s:Moby-Dick/Chapter chapter 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the people of that island erected lofty spars along the seacoast, to which the look-outs ascended by means of nailed \u0027\u0027cleats\u0027\u0027, something as fowls go upstairs in a hen-house\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A continuous metal strip, or angled piece, used to secure metal components\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A device to quickly affix a line or rope, and from which it is also easy to release\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A protrusion on the bottom of a shoe meant for better traction. (See cleats\", \"priority\":6}]}, \"synonyms\":{}}");

	add("cleanliness", "{\"term\":\"cleanliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cleanly|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the property of being cleanly, or habitually clean; good hygien\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Cleanliness\u0027\u0027 is next to godliness.\u0027 (proverb\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cleanness", "{\"term\":\"cleanness\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) {{m|ang|clǣnnes}}, corresponding to {{suffix|clean|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Moral purity; innocence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Certes sayd the good man that is sothe / for he shalle be the best knyghte of the world and the fairest of alle the felauship / But wete yow wel there shall none atteyne it but by \u0027\u0027clennes\u0027\u0027 that is pure confession\u0026lt;!--Prior quote\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But wyte you welle, there shall none attayne hit but by \u0027\u0027clennes\u0027\u0027, that ys pure confession.--\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of being physically clean and free of contamination or dirt; cleanliness\", \"priority\":4}]}, \"synonyms\":{}}");

