	add("cleanskin", "{\"term\":\"cleanskin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|clean|skin|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unbranded animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027, w:Joseph Joseph Furphy, \u0027Rigby′s Romance\u0027, [http://gutenberg.net.au/ebooks06/0607461h.html Gutenberg Australia eBook\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"0607461h\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"No one had any clear notion of how many head might be collected, but we counted on something over four hundred--possibly up to five hundred and fifty, including calves and \u0027\u0027cleanskins\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Tom Cole, \u0027Hell West and Crooked\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I started off lassoing the \u0027\u0027cleanskins\u0027\u0027, dragging them up bellowing to the bronco panel where they were quickly leg-roped, thrown and branded\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Darrell Lewis \u0026amp; Charles Schultz, \u0027Beyond the Big Run\u0027, p. 96\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The bullocks would be in the lead and you\u0027d whip in and let the bullocks go to hell, but hang to your \u0027\u0027cleanskins\u0027\u0027 as much as you could\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Someone with no prior criminal record, a person with no previous convictions; loosely, someone who has not done anything wrong before, an unblemished character\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Poul Anderson, \u0027Shocking Australian True Crime Stories\u0027, %22cleanskins%22+police+OR+cricket+-intitle:%22cleanskin|cleanskins%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzK4oT_T-EsL4rQeI1fnXAQ\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22cleanskins%22%20police%20OR%20cricket%20-intitle%3A%22cleanskin|cleanskins%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 169\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Ryan′s natural father was a \u0027\u0027cleanskin\u0027\u0027 – a police term for a person with no criminal history – who found himself caught up in the world of career criminals when he married into The Clan\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Gaby Hinsliff, \u0027The Guardian\u0027, 19 Apr 2010\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"So the only strategy likely to hurt Clegg in those circumstances involves arguing that the Lib Dems are part of the mould too – not \u0027\u0027cleanskins\u0027\u0027, but a party with 60-plus MPs in that last discredited parliament\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An unlabelled bottle of wine\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Teresa Ooi, \u0027The Australian\u0027, 16 Apr 2010\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Mr McKenzie said that two years ago a decent bottle of sauvignon blanc sold for $15 to $20, but today prices were down to $10 a bottle. \u0026quot;More \u0027\u0027cleanskins\u0027\u0027 entering the market is the first indication there is too much SB out there,\u0026quot; he said\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Terry Lee Stone, \u0027Managing the Design Process Implementing Design: An Essential Manual for the Working Designer\u0027, %22cleanskins%22+-intitle:%22cleanskin|cleanskins%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ds6woT5-GLY-JrAfDprC1AQ\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"%22cleanskins%22%20-intitle%3A%22cleanskin|cleanskins%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 47\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"In 2009, Back Label commissioned Voice to design a label for its \u0027\u0027cleanskin\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Craig Sherborne, \u0027The Amateur Science of Love\u0027, p. 64\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"My eye-whites still woke up bright and clear despite the night before\u0027s two bottles of cheap \u0027\u0027cleanskin\u0027\u0027 wine\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"An undercover police officer who has not done a particular task before\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A cricket bat with no maker\u0027s logo\", \"priority\":24}]}, \"synonyms\":{}}");

