	add("clearance", "{\"term\":\"clearance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clear|ance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of clearing or something (such as a space) cleare\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The distance between two moving objects, especially between parts of a machin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The height or width of a tunnel, bridge or other passage, or the distance between a vehicle and the walls or roof of such passage; a gap, headroom\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A permission for a vehicle to proceed, or for a person to travel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The plane got \u0027\u0027clearance\u0027\u0027 from air traffic control, and we were off\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He got \u0027\u0027clearance\u0027\u0027 to travel to America, even though he had previous links to terrorists\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A permission to have access to sensitive or secret documents or other informatio\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A sale of merchandise at a reduced price\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The settlement of transactions involving securities or means of payment such as checks by means of a clearing house\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The removal of harmful substances from the blood; renal clearance\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The act of potting all the remaining balls on a table at one visit\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The act of kicking a ball away from the goal one is defending\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Removal of pieces from a rank, file or diagonal so that a bishop, rook or queen is free to move along it\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Clear or net profit\", \"priority\":14}]}, \"synonyms\":{}}");

