	add("clearness", "{\"term\":\"clearness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|clear|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Brightness, brilliancy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Thenne sayd he Fair swete fader Ihesu Cryst yf euer I dyd thyng that pleasyd the lord / for thy pyte ne haue me not in despyte for my synnes done afore tyme / and that thou shewe me some thynge of that I seke / And with that he sawe the chamber dore open and there came oute a grete \u0027\u0027clerenes\u0027\u0027 / that the hows was as bryghte as all torches of the world had ben there\u0026lt;!--Prior quote\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And with that he saw the chambir dore opyn, and there cam oute a grete \u0027\u0027clerenesse\u0027\u0027, that the house was as bryght as all the tourcheis of the worlde had bene there.--\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mental or sensory distinctness; clarity of understanding, perception etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, \u0026quot;The Lowest Depths\u0026quot;, \u0027Time\u0027, 6 September\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The daily press is the evil principle of the modern world, and time will only serve to disclose this fact with greater and greater \u0027\u0027clearness\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The state of being free from obscurities or opacity; distinctness of light, colour etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027clearness\u0027\u0027 of the water meant I could still see the key lying on the river-bed\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The state of being free from obstruction or interference\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027clearness\u0027\u0027 of the path made for an easy hike\", \"priority\":10}]}, \"synonyms\":{}}");

