	add("clearway", "{\"term\":\"clearway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|clear|way|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A road or other path that is kept free of obstructions, or on which stopping is strictly regulated, in order to maintain free flow of movement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, Institute of Marine Engineers, \u0027Marine Engineers Review\u0027, %22clearways%22+-intitle:%22clearway%22+-inauthor:%22%22\u0026amp;dq\u003d%22clearway%22|%22clearways%22+-intitle:%22clearway%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyR8pT5fnA-K3iQe6iNXmAg\u0026amp;redir_esc\u003dy page 190\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The traffic lanes of the sea can be \u0027\u0027clearways\u0027\u0027 for thousands of miles\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, UK Department for Transport, \u0027Know Your Traffic Signs\u0027, %22clearways%22+-intitle:%22clearway%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drtsoT4ODBIbMrQe3h_CyAQ\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"%22clearways%22%20-intitle%3A%22clearway%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 55\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The red cross means no stopping, not even to pick up or set down passengers. The sign is used to indicate a 24-hour \u0027\u0027clearway\u0027\u0027 (usually on a rural road) or may be incorporated into other signs with the words “No stopping” (e.g. the “no stopping except local buses” sign at bus stops. On a 24-hour \u0027\u0027clearway\u0027\u0027, the prohibition of stopping applies only to the main carriageway. You may stop in a lay-by unless there are signs to say otherwise. A 24-hour \u0027\u0027clearway\u0027\u0027 does not have any special road markings, but there should be smaller repeater signs at approximately one mile intervals\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An area projecting from the end of a runway that is kept clear of obstructions exceeding a height that increases with distance from the end of the runway\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Antonín Kazda, Robert E. Caves, \u0027Airport Design and Operation\u0027, %22clearways%22+-intitle:%22clearway%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drtsoT4ODBIbMrQe3h_CyAQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22clearways%22%20-intitle%3A%22clearway%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 100\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027clearway\u0027\u0027 may be provided to extend the takeoff distance available (TODA) beyond the end of the hard surface which defines the declarable length of the available takeoff run (TORA\", \"priority\":10}]}, \"synonyms\":{}}");

	add("cleavage", "{\"term\":\"cleavage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|cleave|age|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Aria Giovanni DSC thumb|Cleavage between breast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of cleaving or the state of being cleft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The tendency of a crystal to split along specific planes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The repeated division of a cell into daughter cells after mitosis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The hollow or separation between a woman\u0027s breasts, especially as revealed by a low neckline\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, \u0026quot;Cinema: Cleavage and the Code\u0026quot;, \u0027Time\u0027, 5 Aug 1946\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Low-cut Restoration costumes worn by the Misses Lockwood and Roc (see cut) display too much \u0026quot;\u0027\u0027cleavage\u0027\u0027\u0026quot; (Johnston Office trade term for the shadowed depression dividing an actress\u0027 bosom into two distinct sections\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The splitting of a large molecule into smaller ones\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The division of voters into voting blocs\", \"priority\":9}]}, \"synonyms\":{}}");

	add("cleaver", "{\"term\":\"cleaver\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From {{suffix|cleave|er|lang\u003den}}, compare Middle english (1100-1500) \u0027clevere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Couperet à débiter les lapins thumb|A cleaver\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A squarish, heavy knife used by butchers for hacking through bones et\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, \u0027\u0027 s:The Merry Adventures of Robin Hood/Chapter Chapter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When he came to Nottingham, he entered that part of the market where butchers stood, and took up his inn in the best place he could find. Next, he opened his stall and spread his meat upon the bench, then, taking his \u0027\u0027cleaver\u0027\u0027 and steel and clattering them together, he trolled aloud in merry tones\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of clave, or rhythm stick, a concussive musical instrument used in traditional Bahamian music\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cledonomancy", "{\"term\":\"cledonomancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027kledon\u0027, \u0026quot;an omen\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination through interpreting random remarks, statements or events\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027 Encyc. of Religion \u0026amp; Ethic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The consultant whispered his questions into the god\u0027s ear, then stopped his own ears, went out, and, when he got beyond the market-place, listened for chance words from passers-by. These were construed into an answer. This form of divination (cledonomancy) remained popular at all periods\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027 B.I. Rakoczi in Man, Myth \u0026amp; Magic v\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Pausanias (2nd century AD) gives an example of cledonomancy. A man was not sure whether to marry a young woman of his own clan or a rich woman of more exalted rank. While thinking over the problem, he heard a child at play with his fellows shout, \u0027Take care of yourself\u0027 which he at once understood to mean that he should marry the rich one\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cleft", "{\"term\":\"cleft\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"Dutch\", \"Swedish\"], \"text\":\"{{PIE root|en|glewbʰ}}From Old english (ca. 450-1100) \u0027clift\u0027 compare Dutch \u0027klucht|lang\u003dnl\u0027 () Swedish \u0027klyft|lang\u003dsv\u0027 () cave, den, German \u0027kluft\u0027 See {{m|en|cleave}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opening, fissure, or V-shaped indentation made by or as if by splitting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A piece made by splitting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027cleft\u0027\u0027 of wood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A disease of horses; a crack on the band of the pastern\", \"priority\":4}]}, \"synonyms\":{}}");

