	add("clemency", "{\"term\":\"clemency\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027clēmentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The gentle or kind exercise of power; leniency, mercy; compassion in judging or punishing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1601\u0027\u0027, William Shakespeare, \u0027Hamlet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For vs, and for our Tragedie, / Heere stooping to your \u0027\u0027Clemencie\u0027\u0027: / We begge your hearing Patientlie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Priyamvada Gopal, \u0027The Guardian\u0027, 4 May 2010\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A death sentence for Kasab, seen to represent Pakistan, will be widely supported in a frenzy of righteous retribution. Presidential \u0027\u0027clemency\u0027\u0027 is politically improbable\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Mildness of weather\", \"priority\":6}]}, \"synonyms\":{}}");

	add("clementine", "{\"term\":\"clementine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027clémentine\u0027 named for {{w|Clément Rodier}}, the French missionary said to have first bred it.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of small, sweet orange, the result of a cross between a tangerine and Seville orange\", \"priority\":1}]}, \"synonyms\":{}}");

