	add("clench", "{\"term\":\"clench\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|beclenċan}}, causative of \u0027clingan\u0027 (cling) Compare \u0027stink\u0027 and \u0027stench\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Tight grip\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A seal that is applied to formed thin-wall bushings\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A local chapter of the parody religion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Ted Schultz, \u0027The Fringes of Reason\u0027 (page 210\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And perhaps most innovative of all, Drummond and Stang pushed for a policy of \u0027\u0027clench\u0027\u0027 autonomy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Peter Knight, \u0027Conspiracy Theories in American History: An Encyclopedia\u0027 (page 170\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Every SubGenius \u0027\u0027clench\u0027\u0027 is required to have a member who does not believe\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, George D. Chryssides, \u0027Historical Dictionary of New Religious Movements\u0027 (page 95\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Originality is encouraged, and some \u0027\u0027clenches\u0027\u0027 have devised their own distinctive organizational names\", \"priority\":9}]}, \"synonyms\":{}}");

	add("cleopatra", "{\"term\":\"cleopatra\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027κλεοπάτρα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A given name of women in the Ptolemy dynasty of Egypt; notably Queen of Egypt (69 BC - 30 BC); last of the Ptolemy family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clepsydra", "{\"term\":\"clepsydra\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027κλεψύδρα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A water clock, especially as used in the ancient world\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1953\u0027\u0027, John Wyndham, \u0027The Kraken Wakes\u0027, page 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;The dull, unflavoured drops from life\u0027s \u0027\u0027clepsydra\u0027\u0027\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 856\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They sat among the choiring \u0027\u0027clepsydras\u0027\u0027 of the evening garden, time elapsing in a dozen ways, allowing their cigars to go out, keeping a companionable silence\", \"priority\":5}]}, \"synonyms\":{}}");

	add("clergy", "{\"term\":\"clergy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Attested in the 13th Century {{C.E.}}; from \u0027clergie\u0027, from Old french (842-ca. 1400) \u0027sc\u003dpolytonic|clergié\u0027 (learned men) from \u0027sc\u003dpolytonic|clericātus\u0027 () from Latin \u0027sc\u003dpolytonic|clericus\u0027 (one ordained for religious services) from Ancient greek (to 1453) \u0027κληρικός|sc\u003dpolytonic\u0027 (of the clergy)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Body of persons, such as ministers, sheiks, priests and rabbis, who are trained and ordained for religious service\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThen everybody once more knelt, and soon the blessing was pronounced. The choir and the \u0027\u0027clergy\u0027\u0027 trooped out slowly, [\u0026amp;hellip;], down the nave to the western door. [\u0026amp;hellip;] At a seemingly immense distance the surpliced group stopped to say the last prayer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Today we brought together \u0027\u0027clergy\u0027\u0027 from the Wiccan, Christian, New Age and Islamic traditions for an interfaith dialogue\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clergywoman", "{\"term\":\"clergywoman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|clergy|woman|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ordained (female) Christian minister, a female member of the clergy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cleric", "{\"term\":\"cleric\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|clēricus}}, from Ancient greek (to 1453) \u0027lang\u003dgrc\u0027 from \u0027lang\u003dgrc|κλῆρος\u0027 () (Europe; many officers at Athens obtained their offices by lot, as opposed to election [\u0027Liddell and Scott\u0027]), from Proto-indo-european {{m|ine-pro|*kald-}}, {{m|ine-pro|*klād-||timber, log}}, from Proto-indo-european {{m|ine-pro|*kola-}}, {{m|ine-pro|*klā-||to beat, hew, break, destroy, kill}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clergy member\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clericalism", "{\"term\":\"clericalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clerical|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"political or secular power invested in members of the clergy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clerisy", "{\"term\":\"clerisy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Introduced by w:Samuel Taylor Coleridge|Coleridge, apparently after German \u0027Clerisei\u0027; in late Latin \u0027clericia\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An elite group of intellectuals; learned people, the literati\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: By the nineteenth-century \u0027\u0027clerisy\u0027\u0027 [...] Christianity itself, yoked to material civilization, came to be questioned as gross and vulgar. — w:Roy Roy Porter, \u0027Flesh in the Age of Reason\u0027 (Penguin 2004, p. 432\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The clergy, or their opinions, as opposed to the laity.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

