	add("cleromancy", "{\"term\":\"cleromancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027kleros\u0027, \u0026quot;a lot\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination by casting lots (sortilege\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Divination by throwing dice or any such marked objects, like beans, pebbles, or bone\", \"priority\":2}]}, \"synonyms\":{}}");

